import React from "react";

const Projects = () => (
  <section id="projects" className="py-20 bg-bg-secondary">
    <div className="container mx-auto px-8">
      <h2 className="text-4xl font-bold text-text-primary mb-12 text-center">My Projects</h2>
      <div className="grid grid-cols-3 gap-8">
        {[1, 2, 3, 4, 5, 6].map((project) => (
          <div key={project} className="bg-bg-primary rounded-xl overflow-hidden shadow-lg hover:shadow-accent/20 transition-all">
            <img
              src={`/project-${project}.jpg`}
              alt={`Project ${project}`}
              className="w-full h-48 object-cover"
            />
            <div className="p-6">
              <h3 className="text-xl font-semibold text-text-primary mb-2">Project Name</h3>
              <p className="text-text-secondary mb-4">Short project description goes here.</p>
              <div className="flex gap-4">
                <a href="#" className="text-accent hover:text-accent/80">View Live</a>
                <a href="#" className="text-accent hover:text-accent/80">Source Code</a>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  </section>
);

export default Projects;
